import React,{Component} from 'react';

function Select(name)
{

}
function ShowAppointment (){
    
        const appointment=[
           {
            "Name":"Ahmed",
            "speciality":"dentist",
            "Day1":"sunday",
            "Start1" :"1:00",
            "end1":"2:00"
            },
            {
              "Name":"Ahmed",
              "speciality":"dentist",
              "Day1":"monday",
              "Start1" :"2:00",
              "end1":"3:00"
            },

        ];
      
        return(
        <div className='assign'>
            <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
            <u><p className='home-logout'><a href='/'>Home</a></p></u>
            <h1 className='header2'>Appointments</h1>
            <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Speciality</th>
          <th>Day</th>
          <th>Start Time</th>
          <th>End Time</th>
        </tr>
      </thead>
      <tbody>
        {appointment.map((appointment, index) => {
          // Use an if statement to conditionally render appointments with the name "osama"
          if (appointment.Name.toLowerCase() === 'osama') {
            return (
              <tr key={index}>
                <td>{appointment.Name}</td>
                <td>{appointment.speciality}</td>
                <td>{appointment.Day1}</td>
                <td>{appointment.Start1}</td>
                <td>{appointment.end1}</td>
              </tr>
            );
          } else {
            // Return null for appointments that don't match the condition
            return null;
          }
        })}
      </tbody>
    </table>
            <button ><a href='/ChooseDoc'>Back</a></button>
        </div>
        )
    
        }  

export default ShowAppointment;
